import React from "react";

import Link from "../Link";

import { DataType } from "../../redux/actions/post";
import {
  PostContainer,
  PostContent,
  Header,
  Title,
  PostId,
  PostText,
} from "./styledComponents";

const Post: React.FC<DataType> = ({ title, body, id, comments }) => (
  <PostContainer>
    <Link text="back" href="/" />
    <PostContent>
      <Header>
        <Title>{title}</Title>
        <PostId>{`Post: ${id}`}</PostId>
      </Header>
      <PostText>{body}</PostText>
    </PostContent>
  </PostContainer>
);

export default Post;
